import Photos from "../../assets/Photos";

const datas =  [
    {
        id:1,
        img:Photos.icons.fura,
        title:"20+ Автомобілів",
        description:"У нас наявні необіхдні вам авто"
    },
    {
        id:2,
        img:Photos.icons.man,
        title:"1874 клієнта",
        description:"Довіряють нам свої вантажі"
    },
    {
        id:3,
        img:Photos.icons.clock,
        title:"Пунктуальність",
        description:"Щороку ми здійснюємо перевезення в той термін, який обумовлений договором"
    },
    {
        id:4,
        img:Photos.icons.images,
        title:"8500 + поїздок щороку",
        description:"Щороку ми здійснюємо більше 8000 перевезень"
    }
]

export {
    datas
}
